//canvas
const canvas = document.getElementById('canvas');
const ctx = canvas.getContext('2d');
//size of image
canvas.width = 1000;
canvas.height = 1000;

//image
const image = new Image();
image.src = 'data:image/png;base64,';

//make animation after loading the image
image.addEventListener('load', function(){
    ctx.drawImage(image, 0, 0, canvas.width, canvas.height);
    const scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.height);
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    pixels = scannedImage;
    scannedImage.data = pixels.data;
    ctx.putImageData(scannedImage, 0, 0);

    let particles = [];
    const numberOfParticles = 5000;

    //calculate relative brightness of each pixels
    let mappedImage = [];
    for(let y = 0; y < canvas.height; y++){
        let row = [];
        for (let x = 0; x < canvas.width; x++) {
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [
                brightness,
                'rgb(' + red + ',' + green + ',' + blue + ')',
            ];
            row.push(cell);
        }
        mappedImage.push(row);
    }

    //calculate relative brightness of pixel
    function calculateRelativeBrightness(red, green, blue) {
        return (red * 0.299 + green * 0.587 + blue * 0.114) / 255;
    }

    class Partincal {
        constructor(){
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 1.5;
            this.size = Math.random() * 1.5 + 1;
            this.positionX = Math.floor(this.x);
            this.positionY = Math.floor(this.y);
            this.angle = 0;
        }
        update(){
            this.positionX = Math.floor(this.x);
            this.positionY = Math.floor(this.y);
            if(mappedImage[this.positionY] && mappedImage[this.positionY][this.positionX]){
                this.speed = mappedImage[this.positionY][this.positionX][0];
            }
            let movement = (1.3 - this.speed) * 2 + this.velocity;
            this.angle+=this.speed / 20;

            this.y += movement + Math.sin(this.angle) * 3;
            if(this.y >= canvas.height){
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }

            this.x += movement * 3 + Math.cos(this.angle) * 3;
            if(this.x >= canvas.width){
                this.x = 0;
                this.y = Math.random() * canvas.height;
            }
        }
        draw(){
            ctx.beginPath();
            if(mappedImage[this.positionY] && mappedImage[this.positionY][this.positionX]){
                ctx.fillStyle = mappedImage[this.positionY][this.positionX][1];
            }
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
    }

    //create Particles
    function init() {
        for (let i = 0; i < numberOfParticles; i++) {
            particles.push(new Partincal);
        }
    }
    init();
    
    //main function of animation
    function animate() {
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgb(0, 0, 0)';
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.2;
        for (let i = 0; i < particles.length; i++) {
            particles[i].update();
            ctx.globalAlpha = particles[i].speed * 0.6;
            particles[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate();
});